import React from 'react';
import { useState,useEffect} from 'react';

const Home = () => {
  const [news,setNews]=useState("Heyy");
  const hi=[
    "cute","sweet"
  ]
  let api="https://api.rss2json.com/v1/api.json?rss_url=https%3A%2F%2Ftimesofindia.indiatimes.com%2Frssfeedstopstories.cms";
  const fetchApiData=async(url)=>{
   try {
       const res=await fetch(url);
       const data=await res.json();
       setNews(data.items);
       console.log(news);
   } catch (error) {
       console.log(error);
   }
  }
   useEffect(()=>{
       fetchApiData(api);
   },[]);

  //  news.map((element)=>{
  //   return <div className='home'>
  //     <h1>{element.title}</h1>
  //   </div>
  //  })
  return (
    
     <>
     <div className="home">
      <h1>{news[0].title}</h1>
      <p>{news[0].description}</p>
     </div>
     <div className="home">
      <h1>{news[1].title}</h1>
      <p>{news[1].description}</p>
     </div>
     {hi.map((element)=>{
      <div className='home'>
      <h1>{element}</h1>
      </div>
     })}
      
     </>
   
  )
}

export default Home;
